import React from 'react'
import './Account.css'
import backIcon from '../assets/previous.png'
import {Link} from 'react-router-dom'

const Header = (props) => {
    return(
        <div className="Header">
            {props.header}
            <Link onClick={props.link}><i className='fa fa-angle-left'></i></Link>
        </div>
    )
}

export default Header
